import React, { useState } from "react";

function App() {
  const [jd, setJd] = useState(null);
  const [resumes, setResumes] = useState([]);
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleJDChange = (e) => setJd(e.target.files[0]);
  const handleResumeChange = (e) => setResumes(Array.from(e.target.files));

  const handleAnalyze = async () => {
    if (!jd || resumes.length === 0) {
      alert("Please upload JD and at least one resume!");
      return;
    }

    setLoading(true);
    const formData = new FormData();
    formData.append("jd", jd);
    resumes.forEach((file) => formData.append("resumes", file));

    const response = await fetch("http://127.0.0.1:8000/analyze/", {
      method: "POST",
      body: formData,
    });

    const data = await response.json();
    setResults(data.results);
    setLoading(false);
  };

  return (
    <div className="flex flex-col items-center min-h-screen bg-gray-100 p-10">
      <div className="bg-white shadow-xl rounded-2xl p-8 w-[700px] text-center">
        <h1 className="text-2xl font-bold mb-6">Resume Screening Tool</h1>

        <div className="mb-4">
          <label className="font-semibold mr-3">Upload Job Description (JD):</label>
          <input type="file" onChange={handleJDChange} />
        </div>

        <div className="mb-6">
          <label className="font-semibold mr-3">Upload Resumes:</label>
          <input type="file" multiple onChange={handleResumeChange} />
        </div>

        <button
          onClick={handleAnalyze}
          className="bg-blue-600 text-white font-semibold px-6 py-2 rounded-lg hover:bg-blue-700"
        >
          {loading ? "Analyzing..." : "Analyze"}
        </button>
      </div>

      <div className="mt-10 w-[90%] max-w-6xl">
        <h2 className="text-xl font-bold mb-3 text-center">Analysis Results</h2>

        {results.length > 0 && (
          <table className="w-full border-collapse border border-gray-400 text-sm text-center">
            <thead>
              <tr className="bg-gray-200">
                <th className="border border-gray-400 p-2">Name</th>
                <th className="border border-gray-400 p-2">Strengths</th>
                <th className="border border-gray-400 p-2">Missing</th>
                <th className="border border-gray-400 p-2">Primary Score</th>
                <th className="border border-gray-400 p-2">Secondary Score</th>
                <th className="border border-gray-400 p-2">Overall Score</th>
              </tr>
            </thead>
            <tbody>
              {results.map((res, index) => (
                <tr key={index} className="hover:bg-gray-50">
                  <td className="border border-gray-400 p-2">{res.Name}</td>
                  <td className="border border-gray-400 p-2">{res.Strengths}</td>
                  <td className="border border-gray-400 p-2">{res.Missing}</td>
                  <td className="border border-gray-400 p-2">{res["Primary Score"]}</td>
                  <td className="border border-gray-400 p-2">{res["Secondary Score"]}</td>
                  <td className="border border-gray-400 p-2 font-bold">{res["Overall Score"]}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default App;
